import PageSlider from '../PageSlider';
import Home from '../Home';
import About from '../About';

import styles from './styles.module.css';

const Pages = () => {
  return (
    <div className={styles.container}>
      <PageSlider>
        <div id="home">
          <Home />
        </div>
        <div id="about">
          <About />
        </div>
      </PageSlider>
    </div>
  );
};

export default Pages;
